import React from 'react';
import './Footer.css';
import myicon from './image/myicon.png';

class Footer extends React.Component {
  render() {
    return (
      <div className='footer'>
        <div className='footer-wrapper'>
          <div className='footer-title'>
           Contact
          </div>
        </div>
      </div>
    );
  }
}

export default Footer;
